import React, { useState, useEffect } from 'react';

const ContractInput = ({ onContractChange, initialContract }) => {
  const [level, setLevel] = useState('');
  const [suit, setSuit] = useState('');
  const [declarer, setDeclarer] = useState('');
  const [doubled, setDoubled] = useState('-');

  // Initialize from props if provided
  useEffect(() => {
    console.log("ContractInput initialContract changed:", initialContract); // Debug log
    
    // Reset all selections when initialContract is cleared
    if (!initialContract) {
      console.log("No initialContract, resetting all selections"); // Debug log
      setLevel('');
      setSuit('');
      setDeclarer('');
      setDoubled('-');
      return;
    }
    
    const match = initialContract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
    if (match) {
      console.log("Contract match successful:", match); // Debug log
      setLevel(parseInt(match[1]));
      setSuit(match[2]);
      setDeclarer(match[3]);
      setDoubled(match[4] === '' ? '-' : match[4]);
      
      console.log("Set states to:", parseInt(match[1]), match[2], match[3], match[4] === '' ? '-' : match[4]); // Debug log
    } else {
      console.log("Contract match failed for:", initialContract); // Debug log
    }
  }, [initialContract]);

  // Debug log state changes
  useEffect(() => {
    console.log("Current selection states:", { level, suit, declarer, doubled });
  }, [level, suit, declarer, doubled]);

  // Suits in bridge: Clubs (♣), Diamonds (♦), Hearts (♥), Spades (♠), No Trump (NT)
  const levels = [1, 2, 3, 4, 5, 6, 7];
  const suits = ['♠', '♥', '♦', '♣', 'NT'];
  const players = ['N', 'E', 'S', 'W'];
  const doubledOptions = ['-', 'X', 'XX'];

  // Update the contract whenever any value changes
  const updateContract = (newLevel, newSuit, newDeclarer, newDoubled) => {
    // Only form a contract if we have the minimum required values
    if (newLevel && newSuit && newDeclarer) {
      const contractString = `${newLevel}${newSuit} ${newDeclarer}${newDoubled === '-' ? '' : newDoubled}`;
      console.log("Updating contract to:", contractString); // Debug log
      onContractChange(contractString);
    } else {
      console.log("Insufficient data for contract, clearing"); // Debug log
      onContractChange('');
    }
  };

  const handleLevelChange = (newLevel) => {
    console.log("Level changed to:", newLevel); // Debug log
    setLevel(newLevel);
    updateContract(newLevel, suit, declarer, doubled);
  };

  const handleSuitChange = (newSuit) => {
    console.log("Suit changed to:", newSuit); // Debug log
    setSuit(newSuit);
    updateContract(level, newSuit, declarer, doubled);
  };

  const handleDeclarerChange = (newDeclarer) => {
    console.log("Declarer changed to:", newDeclarer); // Debug log
    setDeclarer(newDeclarer);
    updateContract(level, suit, newDeclarer, doubled);
  };

  const handleDoubledChange = (newDoubled) => {
    console.log("Doubled changed to:", newDoubled); // Debug log
    setDoubled(newDoubled);
    updateContract(level, suit, declarer, newDoubled);
  };

  return (
    <div className="contract-input">
      <div className="level-row">
        {levels.map(l => {
          console.log(`Rendering level ${l}, selected:`, level === l); // Debug log
          return (
            <button 
              key={`level-${l}`}
              className={level === l ? 'selected' : ''}
              onClick={() => handleLevelChange(l)}
            >
              {l}
            </button>
          );
        })}
      </div>

      <div className="suit-row">
        {suits.map(s => {
          let suitClass = '';
          if (s === '♥' || s === '♦') {
            suitClass = 'red-suit';
          }
          
          console.log(`Rendering suit ${s}, selected:`, suit === s); // Debug log
          
          return (
            <button 
              key={`suit-${s}`}
              className={`${suitClass} ${suit === s ? 'selected' : ''}`}
              onClick={() => handleSuitChange(s)}
            >
              {s}
            </button>
          );
        })}
      </div>

      <div className="declarer-row">
        {players.map(p => {
          console.log(`Rendering declarer ${p}, selected:`, declarer === p); // Debug log
          return (
            <button 
              key={`declarer-${p}`}
              className={declarer === p ? 'selected' : ''}
              onClick={() => handleDeclarerChange(p)}
            >
              {p}
            </button>
          );
        })}
      </div>

      <div className="doubled-row">
        {doubledOptions.map(d => {
          console.log(`Rendering doubled ${d}, selected:`, doubled === d); // Debug log
          return (
            <button 
              key={`doubled-${d}`}
              className={doubled === d ? 'selected' : ''}
              onClick={() => handleDoubledChange(d)}
            >
              {d}
            </button>
          );
        })}
      </div>
      
      {level && suit && declarer && (
        <div className="current-contract">
          {level}{suit} {declarer}{doubled === '-' ? '' : doubled}
        </div>
      )}
    </div>
  );
};

export default ContractInput;
